-- ----------------------------
-- Procedure structure for [dbo].[sp_CreateBand]
-- ----------------------------
 

CREATE PROCEDURE [dbo].[sp_CreateBand]
@id int,
@band varchar(5)

AS
BEGIN


	if not exists(select * from band where id = @id and id <> 0)
	
		BEGIN
		
			INSERT INTO [band]
				   (band)
			 VALUES
				   (@band)

		END
	
	else
	
		BEGIN	
		
			UPDATE band set 
			band = @band
			WHERE id = @id
		
		END				         

END
GO

