-- ----------------------------
 

CREATE PROCEDURE [dbo].[sp_CreateUser]
@id numeric(18, 0),
@userid varchar(50),
@passwd varchar(50),
@userstatus int,
@img varchar(350)

AS
BEGIN


	if not exists(select * from login where id = @id)
	
		BEGIN
		
			INSERT INTO [login]
				   (userid
				   ,passwd
				   ,userstatus
				   ,img)
			 VALUES
				   (@userid
				   ,@passwd
				   ,@userstatus
				   ,@img)

		END
	
	else
	
		BEGIN	
		
			UPDATE login set 
			userid = @userid,
			passwd = @passwd,
			userstatus = @userstatus,
			img = @img
			WHERE id = @id
		
		END				
          

END
GO

-- ----------------------------
-- Procedure structure for [dbo].[sp_GetRecords]
-- ----------------------------
 


CREATE PROCEDURE [dbo].[sp_GetRecords]
@formid numeric(18, 0),
@fldvalue int,
@visitid int

AS
BEGIN

	if @fldvalue = 0
	
		select * from category
		
	if @fldvalue = 1
	
		select * from emptype
		
	if @fldvalue = 2
	
		select * from qualification	
		
	if @fldvalue = 3
	
		select * from band
		
	if @fldvalue = 4
	
		select * from location
		
	if @fldvalue = 5
	
		select [id]
      ,[userid]
      ,[passwd]
      ,case when [userstatus] = 1 then 'Active' else
      'In-Active' end [userstatus]
      ,case when [role] = 1 then 'Administrator' else
      'HR User' end [role]
      ,[img] from login
      
      
     if @fldvalue = 6
	
		select [id]
      ,[userid]
      ,[passwd]
      ,case when [userstatus] = 1 then 'Active' else
      'In-Active' end [userstatus]
      ,case when [role] = 1 then 'Administrator' else
      'HR User' end [role]
      ,'..\' + [img] [img] from login
      
      
     if @fldvalue = 7
	
		select [id]
      ,[userid]
      ,[passwd]
      ,case when [userstatus] = 1 then 'Active' else
      'In-Active' end [userstatus]
      ,case when [role] = 1 then 'Administrator' else
      'HR User' end [role]
      ,[img] [img1]
      ,'..\' + [img] [img] from login where id = @formid
      
      
     if @fldvalue = 8
	
		select * from desig where id <> 0
		
		
	if @fldvalue = 9
	
		delete from desig where id = @formid
		
		
	if @fldvalue = 10
	
		delete from login where id = @formid
		
		
	if @fldvalue = 11
	
		select * from desig where id = @formid
		
		
	if @fldvalue = 12
	
		select * from desig	order by desig
		
		
	if @fldvalue = 13
	
		select * from band where id <> 0
		
		
	if @fldvalue = 14
	
		delete from band where id = @formid	
		
		
	if @fldvalue = 15
	
		select * from band where id = @formid	
		
		
	if @fldvalue = 16
	
		select * from band
				
		
	if @fldvalue = 17
	
		select * from location where id <> 0
		
		
	if @fldvalue = 18
	
		delete from location where id = @formid	
		
		
	if @fldvalue = 19
	
		select * from location where id = @formid	
		
		
	if @fldvalue = 20
	
		select * from location		
		
		
	if @fldvalue = 21
	
		select * from qualification where id <> 0
		
		
	if @fldvalue = 22
	
		delete from qualification where id = @formid
		
		
	if @fldvalue = 23
	
		select * from qualification where id = @formid	
		
		
	if @fldvalue = 24
	
		select * from qualification	
      
	
END
GO

-- ----------------------------
-- Procedure structure for [dbo].[sp_InsertImageSection]
-- ----------------------------
 


CREATE PROCEDURE [dbo].[sp_InsertImageSection]
@id numeric(18, 0),
@userid varchar(50),
@passwd varchar(50),
@userstatus int,
@img varchar(350)

AS
BEGIN


	if not exists(select * from login where id = @id)
	
		BEGIN
		
			INSERT INTO [login]
				   (userid
				   ,passwd
				   ,userstatus
				   ,img)
			 VALUES
				   (@userid
				   ,@passwd
				   ,@userstatus
				   ,@img)

		END
	
	else
	
		BEGIN	
		
			UPDATE login set 
			userid = @userid,
			passwd = @passwd,
			userstatus = @userstatus,
			img = @img
			WHERE id = @id
		
		END				
          

END


GO

