CREATE PROCEDURE [dbo].[sp_SaveData]
@ddlemptype int,
@ddlcategory int,
@empno int,
@empname varchar(70),
@cnicno varchar(15),
@cnicexdt datetime,
@dob datetime,
@qual int,
@landline varchar(20),
@cellno1 varchar(15),
@cellno2 varchar(15),
@personnme varchar(70),
@emcellno varchar(15),
@emlandno varchar(8),
@resaddr varchar(200),
@gncno varchar(10),
@ddlband int,
@titdesi int,
@rehiredt datetime,
@conexpiry datetime,
@workproj varchar(70),
@chargproj varchar(12),
@ddlloc int,
@supernme varchar(70),
@hiresalary varchar(10),
@ddlhardship int,
@amount varchar(10),
@benefits int,
@peme int,
@gop int,
@gopdt datetime,
@cardissue int,
@letterapp int,
@confirmation int,
@status int,
@remarks varchar(200),
@pic varchar(150),
@doc varchar(150),
@userid int,
@entrydate datetime

AS
BEGIN

	if not exists(select * from forms where empno = @empno)
	
	BEGIN
	
		INSERT INTO [forms]
			   ([ddlemptype]
			   ,[ddlcategory]
			   ,[empno]
			   ,[empname]
			   ,[cnicno]
			   ,[cnicexdt]
			   ,[dob]
			   ,[qual]
			   ,[landline]
			   ,[cellno1]
			   ,[cellno2]
			   ,[personnme]
			   ,[emcellno]
			   ,[emlandno]
			   ,[resaddr]
			   ,[gncno]
			   ,[ddlband]
			   ,[titdesi]
			   ,[rehiredt]
			   ,[conexpiry]
			   ,[workproj]
			   ,[chargproj]
			   ,[ddlloc]
			   ,[supernme]
			   ,[hiresalary]
			   ,[ddlhardship]
			   ,[amount]
			   ,[benefits]
			   ,[peme]
			   ,[gop]
			   ,[gopdt]
			   ,[cardissue]
			   ,[letterapp]
			   ,[confirmation]
			   ,[status]
			   ,[remarks]
			   ,[pic]
			   ,[doc]
			   ,[userid]
			   ,[entrydate])
		 VALUES
			   (@ddlemptype
			   ,@ddlcategory
			   ,@empno
			   ,@empname
			   ,@cnicno
			   ,@cnicexdt
			   ,@dob
			   ,@qual
			   ,@landline
			   ,@cellno1
			   ,@cellno2
			   ,@personnme
			   ,@emcellno
			   ,@emlandno
			   ,@resaddr
			   ,@gncno
			   ,@ddlband
			   ,@titdesi
			   ,@rehiredt
			   ,@conexpiry
			   ,@workproj
			   ,@chargproj
			   ,@ddlloc
			   ,@supernme
			   ,@hiresalary
			   ,@ddlhardship
			   ,@amount
			   ,@benefits
			   ,@peme
			   ,@gop
			   ,@gopdt
			   ,@cardissue
			   ,@letterapp
			   ,@confirmation
			   ,@status
			   ,@remarks
			   ,@pic
			   ,@doc
			   ,@userid
			   ,@entrydate)
			   
	END
	
	else	
	
	BEGIN
	
		UPDATE [forms]
		SET [ddlemptype] = @ddlemptype
      ,[ddlcategory] = @ddlcategory      
      ,[empname] = @empname
      ,[cnicno] = @cnicno
      ,[cnicexdt] = @cnicexdt
      ,[dob] = @dob
      ,[qual] = @qual
      ,[landline] = @landline
      ,[cellno1] = @cellno1
      ,[cellno2] = @cellno2
      ,[personnme] = @personnme
      ,[emcellno] = @emcellno
      ,[emlandno] = @emlandno
      ,[resaddr] = @resaddr
      ,[gncno] = @gncno
      ,[ddlband] = @ddlband
      ,[titdesi] = @titdesi
      ,[rehiredt] = @rehiredt
      ,[conexpiry] = @conexpiry
      ,[workproj] = @workproj
      ,[chargproj] = @chargproj
      ,[ddlloc] = @ddlloc
      ,[supernme] = @supernme
      ,[hiresalary] = @hiresalary
      ,[ddlhardship] = @ddlhardship
      ,[amount] = @amount
      ,[benefits] = @benefits
      ,[peme] = @peme
      ,[gop] = @gop
      ,[gopdt] = @gopdt
      ,[cardissue] = @cardissue
      ,[letterapp] = @letterapp
      ,[confirmation] = @confirmation
      ,[status] = @status
      ,[remarks] = @remarks
      ,[pic] = @pic
      ,[doc] = @doc
      where empno = @empno
		

	END
	
END
GO

